$(document).ready(function(){$("#CreateAdDetailInputModel_CategoryId").on("change",function(){var n=$(this).find("option:selected").val();console.log(n);$.ajax({url:"GetSubcategories",type:"GET",data:"categoryId="+n,dataType:"json",success:function(n){$("#CreateAdDetailInputModel_SubCategoryId").empty();$("#CreateAdDetailInputModel_SubCategoryId").append("<option>--Select--<\/option>");$.each(n,function(n,t){$("#CreateAdDetailInputModel_SubCategoryId").append("<option value="+t.id+">"+t.name+"<\/option>");console.log(t.id)})}})})});$(document).ready(function(){var n;$(".trElm").click(function(){n=$(this)});$(".archive").click(function(){var t=$(this).val();console.log(t);$.ajax({url:"ArchiveAd",type:"GET",data:"adId="+t,dataType:"json",success:function(){n.hide("slow",function(){n.remove()})}})})});$(document).ready(function(){var n;$(".removeElement").click(function(){n=$(this)});$(".activate").click(function(){var t=$(this).val();console.log(t);$.ajax({url:"ActivateAd",type:"GET",data:"adId="+t,dataType:"json",success:function(){n.hide("slow",function(){n.remove()})}})})});